webpackJsonp([0x8e6c2ce68f58],{5194:function(e,t){e.exports={data:{post:{html:'<p>In case you couldn\'t tell, I got interrupted last night. Now I forgot what I was going to write.</p>\n<p><a href="http://andrea.editthispage.com">Andrea</a> wrote about the German dairy product <a href="http://andrea.editthispage.com/2001/01/27">Quark</a>. If I had known the English name was "curd", I never would have tried it. I\'d describe Quark as a cross between yogurt and sour cream, not at all like cottage cheese. I like a \'Quark-Creme\' cake, with a mixture of Quark, whipped cream and gelatin poured into a form over strawberries and a shortcake base. </p>\n<p>German Link: Hamburger Abendblatt <a href="http://www.abendblatt.de/contents/ha/news/lokales/html/270101/1327FUS7.HTM">Guildo Horn gibt den Lohengrin in der Staatsoper</a></p>',fields:{title:"Only Time Will Tell",date:"28 Jan 2001",url:"https://papascott.de/2001-01-28-only-time-will-tell/"}}},pathContext:{slug:"/2001-01-28-only-time-will-tell/",prev:{fields:{title:"Only Time Will Tell",date:"27 Jan 2001",slug:"/2001-01-27-only-time-will-tell/"}},next:{fields:{title:"Sometimes you eat the bear, and sometimes the bear eats you",date:"29 Jan 2001",slug:"/2001-01-29-sometimes-you-eat-the-bear-and-sometimes-the-bear-eats-you/"}}}}}});
